import time
import serial
import Jetson.GPIO as GPIO
import sys

# For Permission to use port, use -> $ sudo chmod 666 /dev/ttyTHS1


print("Initializing UART")

hex_string = (b'')

RTS_PIN = 11
CTS_PIN = 13

GPIO.setmode(GPIO.BOARD)
GPIO.setup(RTS_PIN, GPIO.OUT, initial=GPIO.LOW)
GPIO.setup(CTS_PIN, GPIO.IN)

serial_port = serial.Serial(
    port="/dev/ttyTHS1",
    baudrate=9600,
    bytesize=serial.EIGHTBITS,
    parity=serial.PARITY_NONE,
    stopbits=serial.STOPBITS_ONE,
    )
#Wait for ports to initialize
time.sleep(1)

data = hex_string
data = [data[i:i+25] for i in range(0, len(data), 25)] # Break String into managable strips
print(len(data)) 

# Wait for CTS signal
print("Waiting for CTS from RasPi")

while not GPIO.input(CTS_PIN) == 1:
    pass

print("Start Serial Transmission")
 
try:
    for i in range(0, len(data), 1):
        GPIO.output(RTS_PIN, GPIO.HIGH)  # Set RTS signal high
        serial_port.write(bytearray(data[i]))
        time.sleep(0.1)
        if data[i] == data[len(data)-1]:
            print("End of Serial Transmission")
            GPIO.output(RTS_PIN,GPIO.LOW)
            quit()
        else:
            continue
except KeyboardInterrupt:
    print("Program Interrupted")
    GPIO.output(RTS_PIN, GPIO.LOW)
    GPIO.cleanup()
    